import { useState } from "react";

const Home = () => {
  const [name, setName] = useState("mario");
  const [age, setAge] = useState(25);
  const handleClick = () => {
    setName("luige");
    setAge(50);
  };

  return (
    <div className="home">
      <h2>Homepage</h2>
      <p>
        {name} is {age} years old now.
      </p>
      <button onClick={handleClick}>Click me</button>
    </div>
  );
};

export default Home;
